#!/usr/bin/env python

import wandb
import time

MAX_AGE = 600

wandb_api = wandb.Api(timeout=100)
CORTEX_WANDB_TYPE = 'validator'
CORTEX_WANDB_PROJECT = 'cortex-t/multi-modality'
filters = {
    "$and":[
        {"config.type": CORTEX_WANDB_TYPE},
        {"state": "running"}
    ]
}
for run in wandb_api.runs(CORTEX_WANDB_PROJECT, filters=filters):
    lhs = run.lastHistoryStep
    for row in run.scan_history(min_step=lhs,max_step=lhs+1,page_size=1):
        try:
            if time.time()-row['_timestamp']>MAX_AGE:
                print(f'run id={run.id} of {run.user}, timestamp exceeds max age {MAX_AGE}')
                break
        except Exception as e:
            print(f'Exception {e}, should not happen')
